import React, { Component } from 'react';
var $  = require( 'jquery' );

class HomeOne extends Component {
  constructor(props) {
    super(props);
  }


  componentDidMount() {
    $(function(){
      $('#myTable').DataTable();
    });
}
render() {
    return (
        <div className="wrapper">
            <div ref={div => {this.myTable = div;}}> </div>
        </div>);
}
}

export default HomeOne;
